import axios from "axios";


const httpClient = axios.create({
  baseURL: "http://localhost:3000/api"
});
// export const fetchGoogleCallBack = (data)=> httpClient.get('/google/callBack',data);

export const fetchCreateUser = (data)=> httpClient.post('/users', data);


export const fetchGoogleCallBack = (data) => {
  return httpClient.get('/google/callBack', data)
    .then(response => {
      // Получите заголовок 'User-Data'
      const userData = JSON.parse(response.headers['user-data']);
      console.log(userData);
      return userData;
    })
    .catch(error => {
      console.error(error);
    });
};
